    move.f  #0, f0          ; f0 holds current value for sin wave
loop:                       ; main frame loop
    tst.b   @$40000         ; check for vertical blank (temp hack)
    jz      loop            ; if no vbl happened, wait check again
    move.b  0, @$40000      ; reset vbl flag
    jsr     clearscreen     ; call subroutine to clear screen
    sin.f   f0, f1          ; calculate sin value from f0 into f1
    add.f   #0.05, f0       ; increment f0 so it animates over time
    mul.f   #40, f1         ; scale sin value to -40.0 to +40.0 range
    add.f   #76, f1         ; make in centered around screen center
    ftoi.l  f1, d1          ; convert it to integer value in d1
    mulu.l  320, d1         ; multiply by screen row length
    jsr     drawlogo        ; call subroutine to draw the logo
    jmp     loop            ; repeat frame loop forever
                            

    ; subroutine to draw the logo 
    ; expects d1 to hold offset on screen
drawlogo:  
    move.l  logo, a0        ; move address of logo pixels to a0
    move.l  $30000, a1      ; move screen address to a1
    add.l   d1, a1          ; add the logo offset calculated from sin wave
    add.l   96, a1          ; center logo horizontally
    move.l  48, d0          ; d0 is loop index, will count down to 0
logoloop:                   ; each iteration through logoloop will draw one row of logo
    xmov.l  @a0+, @a1+      ; use xmov.l to move 64 pixels in one instruction
    xmov.l  @a0+, @a1+      ; and update the a0/a1 pointers at the same time
    add.l   192, a1         ; we only draw 128 pixels, so skip destination to next row
    djnz    logoloop, d0    ; decrement d0, if it is not zero, draw another row
    ret                     ; return to where subroutine was called from
                            
    ; subroutine to clear screen
clearscreen:                
    move.l clearcol, a0     ; move address of clearcol to a0
    move.l $30000, a1       ; move screen address to a1
    move.l 200, d0          ; d0 is loop index, will count down to 0
clearloop:                  ; each iteration through clearloop will clear one pixel row
    xmov.l  @a0, @a1+       ; use xmov.l to clear 64 pixels in one instruction
    xmov.l  @a0, @a1+       ; and update the destination (a1) pointer at the same time
    xmov.l  @a0, @a1+       ; note that a0 points to 16 predefined long values and is
    xmov.l  @a0, @a1+       ; not incremented, so the same 64 pixel values are written
    xmov.l  @a0, @a1+       ; over and over into the destination
    djnz    clearloop, d0   ; decrement d0, if it is not zero, clear another row
    ret                     ; return to where subroutine was called from

